	add("meronym", "{\"term\":\"meronym\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|mero|onym|lang\u003den}}, from Ancient greek (to 1453) \u0027μέρος\u0027 (part) + \u0027ὄνομα\u0027 (name)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A term used to denote a thing that is a part of something else\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Wheels\u0026quot; is a \u0027\u0027meronym\u0027\u0027 of the word \u0026quot;automobile\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, George A. Miller, “Nouns in WordNet”, in Christiane Fellbaum (editor), \u0027Wordnet: An Electronic Lexical Database\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dRehu8OOzMIMC ]\u0026lt;/sup \u0026gt; MIT Press, ISBN 0-262-06197-X, page 38\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If one starts with some complex whole, like {\u0027automobile\u0027} or {\u0027human_body\u0027}, it can be broken down into several levels of \u0027\u0027meronyms\u0027\u0027, but many of those \u0027\u0027meronyms\u0027\u0027 will also be \u0027\u0027meronyms\u0027\u0027 of other wholes. That is to say, some components serve as parts of many different things: think of all the different mechanisms that have gears\", \"priority\":4}]}, \"synonyms\":{}}");

